import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import NoSsr from '@material-ui/core/NoSsr';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import HomeImage from './home.jpg';
import "~slick-carousel/slick/slick.css";
import "~slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

function TabContainer(props) {
  return (
    <Typography component="div" style={{ padding: 8 * 3 }}>
      {props.children}
    </Typography>
  );
}

TabContainer.propTypes = {
  children: PropTypes.node.isRequired,
};

function LinkTab(props) {
  return <Tab component="a" onClick={event => event.preventDefault()} {...props} />;
}
const styles = {
paperContainer: {
backgroundImage: `url(${ HomeImage })`}
}
export class Home extends React.Component {
  render() {
      return (
          <div style={styles.paperContainer}>
          </div>
      )
  }
}
class SimpleSlider extends React.Component {
  render() {
    var settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };
    return (
      <Slider {...settings}>
        <div>
          <h3>1</h3>
        </div>
        <div>
          <h3>2</h3>
        </div>
        <div>
          <h3>3</h3>
        </div>
        <div>
          <h3>4</h3>
        </div>
        <div>
          <h3>5</h3>
        </div>
        <div>
          <h3>6</h3>
        </div>
      </Slider>
    );
  }
}
class NavTabs extends React.Component {
  state = {
    value: 0,
  };

  handleChange = (event, value) => {
    this.setState({ value });
  };

  render() {
    const { classes } = this.props;
    const { value } = this.state;

    return (

      <NoSsr>
        <div className={classes.root}>
          <AppBar position="static">
            <Tabs variant="fullWidth" value={value} onChange={this.handleChange}>
              <LinkTab label="Home" href="Home" />
              <LinkTab label="Community" href="Community" />
              <LinkTab label="Transporation" href="Transporation" />
              <LinkTab label="Landmarks" href="Landmarks" />
              <LinkTab label="Cafes" href="Cafes" />
            </Tabs>
          </AppBar>
          {value === 0 && <TabContainer>Home</TabContainer>}
          {value === 1 && <TabContainer>Community</TabContainer>}
          {value === 2 && <TabContainer>Transporation</TabContainer>}
          {value === 3 && <TabContainer>Landmarks</TabContainer>}
          {value === 4 && <TabContainer>Cafes</TabContainer>}
        </div>
      </NoSsr>
    );
  }
}

NavTabs.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(NavTabs);
